                tipBox.innerHTML = `<span class="error">‚ùå Èîô‰∫ÜÔºÅÊ≠£Á°ÆÂ≠óÁ¨¶ÊòØ„Äå${correctChar}„ÄçÔºåÂ§ßÊï∞ÊçÆÊê¨ËøêÂèØ‰∏çËÉΩÂá∫ÈîôÔºåÈáçËæìÔºÅ</span>`;
            }
            seqInput.value = "";
        });

        saveBtn.addEventListener("click", () => {
            const saveName = prompt("ËØ∑ËæìÂÖ•Â≠òÊ°£ÂêçÁß∞ÔºàÊØîÂ¶ÇÔºöÊê¨Á†ñÂà∞1000Â≠óÁ¨¶ÔºâÔºö", `ËøõÂ∫¶${currentProgress}`);
            if (saveName) {
                tipBox.innerHTML = `<span class="correct">‚úÖ ÊâãÂä®Â≠òÊ°£„Äå${saveName}„ÄçÊàêÂäüÔºÅÂ∞±ÁÆóÊëÜÁÉÇÔºåËøõÂ∫¶‰πü‰∏ç‰ºö‰∏¢~</span>`;
            }
        });

        progressBtn.addEventListener("click", () => {
            const percent = (currentProgress / TARGET_SEQ.length) * 100;
            const progressWidth = Math.max(1, percent * 3); // Âì™ÊÄï0.005%‰πüÁªô1px
            const compareText = getCompareText(currentProgress);
            
            progressBox.innerHTML = `
                <div style="font-size:14px;color:#666;">‰Ω†ÈùûË¶ÅÁÇπ...Áé∞Âú®ÂêéÊÇîËøòÊù•ÂæóÂèä</div>
                <div style="width:100%;height:20px;background:#eee;border-radius:10px;overflow:hidden;margin:10px 0;">
                    <div style="width:${progressWidth}px;height:100%;background:#FF6347;border-radius:10px;"></div>
                </div>
                <div>ÂΩìÂâçËøõÂ∫¶Ôºö${currentProgress}/${TARGET_SEQ.length}</div>
                <div>ÂÆåÊàêÂ∫¶Ôºö${percent.toFixed(4)}%</div>
                <div style="color:#999;margin-top:5px;">${compareText}</div>
            `;
            progressBox.style.display = "block";
        });

        resetBtn.addEventListener("click", () => {
            if (confirm("Á°ÆÂÆöË¶ÅÈáçÁΩÆÊâÄÊúâËøõÂ∫¶Ôºü‰Ω†‰πãÂâçÊê¨ÁöÑÂ§ßÊï∞ÊçÆÂÖ®ÁôΩÂπ≤‰∫ÜÂì¶~")) {
                currentProgress = 0;
                savedMilestones = new Set();
                localStorage.removeItem("devilSeqProgress");
                localStorage.removeItem("devilSeqMilestones");
                tipBox.innerHTML = "üìù Á¨îËÆ∞ÊèêÁ§∫Ôºö‰Ω†ÈÄâÊã©ÊëÜÁÉÇÔºÅ‰ªéÂ§¥ÂºÄÂßãÂΩìÂ§ßÊï∞ÊçÆÊê¨ËøêÂ∑•Âêß~";
                progressBox.style.display = "none";
                achievementBox.style.display = "none";
            }
        });

        // 8. ËØõÂøÉÊàêÂ∞±ÊñáÊ°à
        function getAchievement(progress) {
            if (progress === 1000) return "„ÄåÊâãÊåáÊäΩÁ≠ãÈ¢ÑÂ§áÂΩπ„Äç- Â∑≤Êê¨1000Â≠óÁ¨¶ÔºåÁªßÁª≠Êê¨ÔºÅ";
            if (progress === 5000) return "„ÄåÂ∞èÊï∞ÊçÆÊê¨ËøêÂ∑•„Äç- Êê¨Á†ñ5000Â≠óÁ¨¶ÔºåËØ•ÊêìÊêìÊâã‰∫Ü~";
            if (progress === 10000) return "„ÄåÂ§ßÊï∞ÊçÆÊê¨ËøêÂ≠¶Âæí„Äç- Êê¨Á†ñ1‰∏áÂ≠óÁ¨¶ÔºåÊîæÂºÉÂ∞±‰∫èÂ§ß‰∫ÜÔºÅ";
            if (progress === 50000) return "„ÄåÂ§ßÊï∞ÊçÆÊê¨ËøêÂ∑•„Äç- Êê¨Á†ñ5‰∏áÂ≠óÁ¨¶ÔºåÊâãÊåáËøòÂ•ΩÂêóÔºü";
            if (progress === 100000) return "„ÄåËµÑÊ∑±Êê¨ËøêÂ∑•„Äç- Êê¨Á†ñ10‰∏áÂ≠óÁ¨¶ÔºåÁ¶ªÈÄöÂÖ≥ËøòÂ∑Æ48‰∏á~";
            if (progress === 500000) return "„ÄåÊ†∏ÂøÉÊê¨ËøêÂ∑•„Äç- Êê¨Á†ñ50‰∏áÂ≠óÁ¨¶ÔºåÁé∞Âú®ÊîæÂºÉ=50‰∏áÊ¨°ÊåâÈîÆÁôΩÊåâÔºÅ";
            return `„ÄåÊê¨Á†ñ${progress}Â≠óÁ¨¶„Äç- ‰Ω†Â∑≤Ë∂ÖË∂ä0.001%ÁöÑÊëÜÁÉÇÁé©ÂÆ∂~`;
        }

        function getCompareText(progress) {
            if (progress < 100) return "Áõ∏ÂΩì‰∫éÔºöÂÜô„ÄäÁ∫¢Ê•ºÊ¢¶„ÄãÂè™ÂÜô‰∫Ü1‰∏™Â≠óÔºåË∑ùÁ¶ªÂÜôÂÆåËøòÂ∑Æ107500Â≠ó";
            if (progress < 1000) return "Áõ∏ÂΩì‰∫éÔºö‰ªéÂåó‰∫¨Ëµ∞Âà∞‰∏äÊµ∑ÔºåÂè™Ëµ∞‰∫Ü0.02Á±≥ÔºåË∑ùÁ¶ªÁªàÁÇπËøòÂ∑Æ1067000Á±≥";
            if (progress < 10000) return "Áõ∏ÂΩì‰∫éÔºöÁÜ¨‰∏ÄÈîÖÁ≤•ÂàöÊîæ‰∫Ü1Á≤íÁ±≥ÔºåË∑ùÁ¶ªÁÜ¨ÁÜüËøòÂ∑Æ589814Á≤í";
            return `Áõ∏ÂΩì‰∫éÔºö‰Ω†Â∑≤ÁªèÂùöÊåÅ‰∫Ü${percent.toFixed(4)}%ÔºÅ‰ΩÜÂâ©‰∏ãÁöÑË¶ÅÈáçÂ§ç${Math.floor(100/percent)}Ê¨°ÂΩìÂâçÂä™Âäõ`;
        }
    </script>
